package Tree;import Temp.Label;import Temp.Temp;import java.util.LinkedList;public class LABEL extends Stm {    public Label label;    public LABEL(Label l) {        label=l;    }    public LinkedList<Exp1> kids() {        return new LinkedList<Exp1>();    }    public Stm build(LinkedList<Exp1> kids) {        return this;    }    public void accept(IntVisitor v, int d) {        v.visit(this, d);    }    public Temp accept(CodeVisitor v) {        v.visit(this);        return null;    }    public <R> R accept(ResultVisitor<R> v) {        return v.visit(this);    }}